var yPos = 1;

var keypad = [
	[1,2,3],
	[4,5,6],
	[7,8,9]
	];
var currentPosition = keypad[xPos][yPos];
console.log(currentPosition);

console.log(keypad);

function findButton(buttonX) {
	keyToPress= buttonX;
	for(var i = 0; i < keyToPress.length; i++) {

		var currentLetter = keyToPress[i];
		switch(currentLetter) {
			case "U": yPos--;
					  if (yPos < 0) yPos = 0;
					  //console.log("new y pos ",yPos);
					  break;
			case "D": yPos++;
					  if (yPos > 2) yPos = 2;
					  // console.log("new y pos ",yPos);
					  break;
			case "L": xPos--;
					  if (xPos < 0) xPos = 0;
					  // console.log("new x pos ",xPos);
					  break;
			case "R": xPos++;
					  if (xPos > 2) xPos = 2;
					  // console.log("new x pos ",xPos);
					  break;
			default: throw new Error("This is no valid direction");
		} 
	}
	console.log("push button: ", keypad[yPos][xPos]);
}
